function LoadTextures(_funComplete){
	InfoTextures.FunComplete = _funComplete;
	LoadTextureId();
}
function LoadTextureId(){
	if(InfoTextures.idLoader<InfoTextures.images.length){
		InfoTextures.nameTexture=InfoTextures.images[InfoTextures.idLoader].name;

		InfoTextures.images[InfoTextures.idLoader].img=new Image();
		InfoTextures.images[InfoTextures.idLoader].img.onload	= CompleteLoadTexture;
		InfoTextures.images[InfoTextures.idLoader].img.onerror	= ErrorLoadTexture;
		InfoTextures.images[InfoTextures.idLoader].img.src = InfoTextures.images[InfoTextures.idLoader].path;

	}else{
		InfoTextures.FunComplete();
	}
}

function CompleteLoadTexture(){
	InfoTextures.textures[InfoTextures.nameTexture]	= PIXI.Texture.fromImage(InfoTextures.images[InfoTextures.idLoader].path);
	InfoTextures.bitmaps[InfoTextures.nameTexture]	= InfoTextures.images[InfoTextures.idLoader].img;

	InfoTextures.idLoader++;
	
	LoadTextureId();
}
function ErrorLoadTexture(){
	alert("Error load:"+InfoTextures.images[InfoTextures.idLoader].name);
	
	InfoTextures.idLoader++;
	
	LoadTextureId();
}